			shellPath = /bin/sh;
			shellScript = "#needed environment variables\nFRAMEWORKS_PATH=\"${CloudKitFrameworks}\"\nBUILD_DIR=\"$TARGET_BUILD_DIR\"\nAPP_NAME=\"${EXECUTABLE_NAME}\"\nXCODE_DIR=\"${SYSTEM_DEVELOPER_DIR}\"\n\n\n\n\n#script\nexport PATH=$PATH:\"${XCODE_DIR}/Platforms/iPhoneOS.platform/Developer/usr/bin:${XCODE_DIR}/usr/bin:/opt/local/bin:/usr/local/bin:/usr/bin:/bin:/usr/sbin:/sbin\"\nexport XCODE_DEVELOPER_USR_PATH=$XCODE_DEVELOPER_USR_PATH:${XCODE_DIR}/usr/bin/..\nAPP_PATH=\"${BUILD_DIR}/${APP_NAME}.app\"\n\ncd $FRAMEWORKS_PATH\nFRAMEWORKS=$(find . -name \"*.framework\")\n\ncd \"$PROJECT_DIR/\"\nPROJ_FILE=$(find . -path \"*${PROJECT}.xcodeproj/project.pbxproj\")\necho $PROJ_FILE\n\nfor f in ${FRAMEWORKS}\ndo\nTMP_PATH=$(echo \"$f\" | cut -b 3-)\necho $TMP_PATH\nTMP_NAME=$(basename $f)\necho $TMP_NAME\n\n#search if this framework version is used in the project\ngrep \"$TMP_PATH\" \"$PROJECT_DIR/$PROJ_FILE\"\nif [ $? -eq 0 ]\nthen\necho \"${TMP_PATH} ${TMP_NAME}\"\nTMP_BUILD_FRAMEWORK_PATH=\"${BUILD_DIR}/${TMP_NAME}\"\nif [ -d \"$TMP_BUILD_FRAMEWORK_PATH\" ] \nthen\nTMP_RESOURCESPATH=\"$TMP_BUILD_FRAMEWORK_PATH/Resources\"\nelse \nTMP_RESOURCESPATH=\"${FRAMEWORKS_PATH}/${TMP_PATH}/Resources\"\nfi\n\necho $TMP_RESOURCESPATH\ncd $TMP_RESOURCESPATH\n\n#copy image by crunching them\nIMAGES=$(find . -name \"*.png\")\nfor img in ${IMAGES}\ndo\n\"${XCODE_DIR}/Platforms/iPhoneOS.platform/Developer/Library/Xcode/PrivatePlugIns/iPhoneOS Build System Support.xcplugin/Contents/Resources/copypng\" -compress \"\" \"$TMP_RESOURCESPATH/$img\" \"$APP_PATH/$img\" \ndone\n\n#compile and copy the core data models\nCORE_DATA_MODELS=$(find . -name \"*.xcdatamodeld\")\nfor cdm in ${CORE_DATA_MODELS}\ndo\n#find the name without extension\nTMP_CMD_NAME=$(basename $cdm)\nCDM_NAME=$(echo \"$TMP_CMD_NAME\" | cut -d'.' -f1)\necho \"${CDM_NAME}\"\n\"${XCODE_DIR}/usr/bin/momc\" -compress \"\" \"$TMP_RESOURCESPATH/$cdm\" \"$APP_PATH/$CDM_NAME.momd\"  \ndone\n\n#compile and copy the xib files\nXIBFILES=$(find . -name \"*.xib\")\nfor xib in ${XIBFILES}\ndo\n#find the name without extension\nTMP_XIB_NAME=$(basename $cdm)\nXIB_NAME=$(echo \"$TMP_XIB_NAME\" | cut -d'.' -f1)\necho \"${XIB_NAME}\"\n\"${XCODE_DIR}/usr/bin/ibtool\" --errors --warnings --notices --output-format human-readable-text --compile \"$APP_PATH/$CDM_NAME.nib\" \"$TMP_RESOURCESPATH/$xib\" --sdk ${SDKROOT}\ndone\n\n\n#simply copy the rest of the files and folders\nrsync -avz --exclude \"*.png\" --exclude \"*.xcdatamodeld\" --exclude \"*.xib\" \"$TMP_RESOURCESPATH/\" \"$APP_PATH/\"\nfi\ndone";
